import React from 'react';
import img from '../src/images/4.jpg';

const Cdata = () => [

        {
            id : 1,
            title : "Awesome Card",
            imgSrc : {img},

        },
        {
            id : 2,
            title : "Awesome 2",
            imgSrc : {img},

        },
        {
            id : 3,
            title : "Awesome 3",
            imgSrc : {img},
            
        },

];

export default Cdata;
